import React from 'react';
import Logo from '../logo.svg';
import '../Decoration/VueAccueil.css';

function VueAccueil(){
    return(
        <div className="vue-accueil-html">
            <div className="titre">
                <h1>Le Quiz des Quiz</h1>
                <img src="https://place-hold.it/150x150"/>
            </div>
        </div>
    );
}

export default VueAccueil;
